import React from 'react'
import { List, ListItem, ListItemText, Button } from '@material-ui/core';
import db from './firebase.js';

function Todo({todo}) {
    return (
        <List>
            <ListItem>
                <ListItemText primary={todo.todo} secondary="Expiry Date üìÖ"></ListItemText>
            </ListItem>
            <Button onClick={event=> db.collection('todos').doc(todo.id).delete()}>‚ùåDelete Me</Button>
        </List>
    )
}

export default Todo;
